using System;

namespace TransITGeometryTransferRevit
{
    /// <summary>
    /// The class containing Revit family templates
    /// </summary>
    public class TemplateFamiliesBase64
    {
        /// <summary>
        /// Tunnel profile template family containing 3 adaptive points to define orientation plane.
        /// </summary>
        public const string profileFamilyTemplateBase64 = "";

        /// <summary>
        /// Tunnel section family template containing 2 adaptive points defining a line that has  tunnel profile family
        /// instances on each end which define a loft shape.
        /// </summary>
        public const string tunnelSectionFamilyTemplateBase64 = "";

        /// <summary>
        /// Empty Metric Mass Revit Family for the Tunnel Family.
        /// </summary>
        public const string tunnelFamilyTemplateBase64 = "";

        /// <summary>
        /// Dumps the given base64 string into a temp file.
        /// </summary>
        /// <param name="base64string"></param>
        /// <returns>The filepath of the template file</returns>
        public static string GetBase64FamilyPath(string base64string)
        {
            string fileName = System.IO.Path.GetTempPath() + Guid.NewGuid().ToString() + ".rfa";
            var logoInBytes = Convert.FromBase64String(base64string);
            System.IO.File.WriteAllBytes(fileName, logoInBytes);

            return fileName;
        }

    }
}
